import axios from "axios";
import React from "react";
import { Link } from "react-router-dom";

const Favorites = () => {
  axios.get("/api/users/favorites").then((res) => {
    console.log(res);
    return res.data;
  });
  return (
    <>
      <Link to="/">Volver</Link>
      <div>Favorites</div>
    </>
  );
};

export default Favorites;
